/* performs linear interpolation on ocv vs soc curve values */
static float soc_lookup(float ocv) {
    if (ocv <= ocv_table[0]) return soc_table[0];
    if (ocv >= ocv_table[TABLE_LENGTH - 1]) return soc_table[TABLE_LENGTH - 1];

    for (int i = 0; i < TABLE_LENGTH - 1; ++i) {
        if (ocv >= ocv_table[i] && ocv <= ocv_table[i + 1]) {
            float ocv_0 = ocv_table[i];
            float ocv_1 = ocv_table[i + 1];
            float soc_0 = soc_table[i];
            float soc_1 = soc_table[i + 1];
            float t = (ocv - ocv_0) / (ocv_1 - ocv_0);
            return soc_0 + t * (soc_1 - soc_0);
        }
    }

    /* unreachable */
    return 0.0f;
}



/* performs linear interpolation on ocv vs soc curve values */
static float ocv_lookup(float soc) {
    if (soc <= ocv_table[0]) return soc_table[0];
    if (soc >= ocv_table[TABLE_LENGTH - 1]) return soc_table[TABLE_LENGTH - 1];

    for (int i = 0; i < TABLE_LENGTH - 1; ++i) {
        if (soc >= ocv_table[i] && soc <= ocv_table[i + 1]) {
            float ocv_0 = ocv_table[i];
            float ocv_1 = ocv_table[i + 1];
            float soc_0 = soc_table[i];
            float soc_1 = soc_table[i + 1];
            float t = (soc - soc_0) / (soc_1 - soc_0);
            return ocv_0 + t * (ocv_1 - ocv_0);
        }
    }

    /* unreachable */
    return 0.0f;
}

